INSERT INTO `guide` VALUES (1,'안녕~ 다들 만나서 반가워!! 나는 어울림학교에 다니는 곰탱이 라고 해. 너희는 어디 학교 다니는지 이름이 뭔지~ 소개 해줄 수 있어?','2023-11-09 01:47:02.000000','2023-11-09 01:47:02.000000'),(2,'나는 만화를 아주 좋아하는데 엉덩이탐정을 가장 좋아해. 너희는 어떤 만화를 좋아해? 친구에게 너가 가장 좋아하는 만화를 소개해줘.','2023-11-09 01:47:02.000000','2023-11-09 01:47:02.000000'),(3,'나는 공룡을 아주 아주 좋아해 어제 마트에 갔는데 공룡 장난감이 정말 멋지더라. 내일 내 생일인데 생일 선물로 공룡 장난감을 받고 싶어. 너희는 생일에 무슨 선물 받고 싶어?','2023-11-09 01:47:02.000000','2023-11-09 01:47:02.000000'),(4,'나는 저번 주에 형이랑 짜장면을 시켜 먹었는데 정말 맛있었어. 너희는 무슨 음식을 제일 좋아해?','2023-11-09 01:47:02.000000','2023-11-09 01:47:02.000000'),(5,'나는 평소에 친구들이랑 숨바꼭질 하는 게 제일 재밌어. 너희는 친구들이랑 뭐하고 놀 때 제일 재밌어?','2023-11-09 01:47:02.000000','2023-11-09 01:47:02.000000'),(6,'나는 의사 선생님이 되는 게 꿈이야. 아픈 사람들을 치료해주는 멋진 의사 선생님이 될 거야. 너희는 꿈이 뭐야?','2023-11-09 01:47:02.000000','2023-11-09 01:47:02.000000'),(7,'나는 요즘 가수 중에 뉴진스가 제일 좋아! 너희는 좋아하는 가수 있어?','2023-11-09 01:47:02.000000','2023-11-09 01:47:02.000000'),(8,'나는 학교에서 배우는 과목 중에 수학 수업을 제일 좋아해. 너희는 무슨 과목을 가장 좋아해?','2023-11-09 01:47:02.000000','2023-11-09 01:47:02.000000'),(9,'나 속상한 일이 있었는데 들어줄래?? 어제, 동생이랑 놀다가 싸워서 엄마한테 혼났거든. 근데 동생이 잘못한건데 엄마가 나만 혼낸 거 있지? 너무 슬펐어... 너희는 슬펐던 적이 있어?','2023-11-09 01:47:02.000000','2023-11-09 01:47:02.000000'),(10,'나는 방학에 가족들이랑 바닷가에 다녀왔던 게 가장 재밌었어. 너희는 가족들과 어디 놀러갔을 때 가장 좋았어? 가장 즐거웠던 기억을 말해줘.','2023-11-09 01:47:02.000000','2023-11-09 01:47:02.000000'),(11,'나는 이번 주말에 엄마 아빠랑 놀이공원에 놀러가고 싶어! 너희는 엄마 아빠랑 뭐하고 싶어?','2023-11-09 01:47:02.000000','2023-11-09 01:47:02.000000'),(12,'나는 엄마 아빠가 나한테 사랑해 라고 할 때 가장 좋아! 너희는 엄마 아빠가 뭐라고 말해줄 때 가장 좋아?','2023-11-09 01:47:02.000000','2023-11-09 01:47:02.000000'),(13,'오늘 너희를 만나서 정말 즐거웠어. 너희는 새로운 친구를 만나보니 어때? 재밌었어?   우리 다음에 또 만나자~~ 안녕~~!','2023-11-09 01:47:02.000000','2023-11-09 01:47:02.000000');
